		\caption{\label{fig:bloch} Schematic illustration of different phases in the coupled-top model: Three large spins are located on a triangle. Their directions are specified by the black arrows on the Bloch sphere. $\lambda_- < \lambda < \lambda_+$ corresponds to the disordered paramagnetic phase with all spins aligning in parallel to the external field in $z$ axis. $\lambda < \lambda_-$ corresponds to the ferromagnetic phase where all spins tend to align in parallel along the $x$ axis. $\lambda > \lambda_+$ corresponds to the frustrated antiferromagnetic phase. Two of the large spins tend to align antiparallel along the $x$ axis, whereas the third one are frozen in $z$ axis. $\lambda_+ = 1$ and $\lambda_- = -\frac{1}{2}$.}
	\end{figure*}

